    public static class TestRecord {
        private final MyEnum myEnum;

        public TestRecord(MyEnum myEnum) {
            this.myEnum = myEnum;
        }

        public MyEnum getMyEnum() {
            return myEnum;
        }
    }

    @Test
    public void testEnumIntrospection() throws Exception {
        // Step 0: Configure property inspection system.
        // The ENUMS constant does not exist; SUPPRESS_CLASS is the correct one to remove.
        PropertyUtils.removeBeanIntrospector(SuppressPropertiesBeanIntrospector.SUPPRESS_CLASS);

        // Step 1: Prepare a test record
        TestRecord testRecord = new TestRecord(MyEnum.VALUE);

        // Step 2: Retrieve the class information
        Object classMetadataResponse = PropertyUtils.getProperty(testRecord, "myEnum.class");

        // Step 3: Verify the system returns the class metadata
        assertNotNull(classMetadataResponse, "Class metadata should not be null after removing the introspector.");
        Class<?> classMetadata = (Class<?>) classMetadataResponse;

        // Step 4: Extract the runtime environment loader
        ClassLoader runtimeLoader = classMetadata.getClassLoader();

        // Step 5: Verify the runtime environment loader is present
        assertNotNull(runtimeLoader, "ClassLoader should not be null.");

        // Step 6: Retrieve the loader information through a nested property path
        Object nestedPathLoaderResponse = PropertyUtils.getProperty(testRecord, "myEnum.class.classLoader");

        // Step 7 & 8: Verify the nested path retrieval
